import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid';
import Sheets from './Sheets';
import './Content.css';
import Thai from './THA.png'



class Content extends Component {
    render() {
        return (
            <div >
                <Grid container spacing={24}>
                
                   

                    <Grid item xs={1}>
                    </Grid> 
                    
                    <Grid item xs={10}>
                        <Sheets />
                    </Grid>

                    <Grid item xs={1}> 
                    <br/>
                                              
                    </Grid>

                </Grid>

            </div>
        );
    }
}
export default Content;
